import React from "react";

const DownloadPhoto = (props)=>{
    const {url, limit, downloaded, name} = props;

    return(
        <div className="download-photo-container">
            <div className="shared-img-container" style={{"backgroundImage": `url("${url}")`}}></div>
            <div className="shared-img-details-container">
                <h3>Uploaded By</h3>
                <p>{name}</p>

                <h3>Downloaded</h3>
                <p>{downloaded} times.</p>

                <h4><span>{limit - downloaded}</span> Downloads Remaining.</h4>
                <button className="hero-btn">Download</button>
            </div>
            
        </div>
    );
};

export default DownloadPhoto;
